import React from 'react';
import {Link} from 'react-router-dom';
import '../Navbar/Navbar.css';

function Navbar (){
    return(
        <>
        <div className='navbar'>
        <div className="leftside"><img src="https://raw.githubusercontent.com/machadop1407/react-website-tutorial/main/src/assets/pizzaLogo.png" /> </div>
        <div className="rightside">
        <Link to="/">Home</Link>
        <Link to="/">Home</Link>
        <Link to="/">Home</Link>
        <Link to="/">Home</Link>
        
        </div>
        </div>
        
     
       
        
        </>
    )
}


export  default Navbar ;
